import React from 'react';
import { getUser } from './getUser';

export const element = () => {
  const user = getUser(); // Call the getUser function to get the user object
  const { firstName, lastName } = user; // Destructure the firstName and lastName fields from the user object

  return (
    <div>
      <div>Welcome on board</div>
      <h2>
        {firstName} {lastName} {/* Display the firstName and lastName fields */}
      </h2>
    </div>
  );
};
